<html>
<head>
<title>Fizz Buzz</title>
<script>
async function computeResults() {
	// Gather the data and compute the summary information
	const entries = await fetchEntries_mock();
	const summaries = new Array();
	for (const entry of entries) {
		const scoresWithId = await fetchScores_mock(entry.id);
		const s = { id: entry.id, order: entry.order };

		if (scoresWithId.length == 0) {
			// Device does not have any score information
			s.scoreMin = -1;
			s.scoreMax = -1;
			s.scoreMean = -1;
			s.calibratedMin = -1;
			s.calibratedMax = -1;
			s.calibratedMean = -1;
		} else {
			// Device has score information (and likely a calibration factor)
			const scores = scoresWithId.map(x => x.score);
			const calibratedScores = scores.map(s => s * entry.calibration);

			// Compute min/max/mean using map-reduce
			s.scoreMin = scores.reduce((prev, cur) => prev < cur ? prev : cur);
			s.scoreMax = scores.reduce((prev, cur) => prev > cur ? prev : cur);
			s.scoreMean = scores.reduce((prev, cur) => prev + cur) / scores.length;

			if (entry.calibration == null) {
				s.calibratedMin = -1;
				s.calibratedMax = -1;
				s.calibratedMean = -1;
			} else {
				// Compute the calibrated min/max/mean
				s.calibratedMin = calibratedScores.reduce((prev, cur) => prev < cur ? prev : cur);
				s.calibratedMax = calibratedScores.reduce((prev, cur) => prev > cur ? prev : cur);
				s.calibratedMean = calibratedScores.reduce((prev, cur) => prev + cur) / calibratedScores.length;
			}
		}

		summaries.push(s);
	}

	// Sort the data by order (ascending) and calibratedMean (descending)
	summaries.sort(function(a, b) {
		if (a.order < b.order) return -1;
		if (a.order > b.order) return 1;
		if (a.calibratedMean > b.calibratedMean) return -1;
		if (a.calibratedMean < b.calibratedMean) return 1;
		return 0;
	});

	// Convert to CSV (note: no need to escape any data since this is strictly numeric)
	var csv = 'id,order,min,max,mean,min_calibrated,max_calibrated,mean_calibrated\n';
	for (const s of summaries) {
		csv +=
			s.id + ',' +
			s.order + ',' +
			s.scoreMin + ',' +
			s.scoreMax + ',' +
			s.scoreMean + ',' +
			s.calibratedMin + ',' +
			s.calibratedMax + ',' +
			s.calibratedMean + '\n';
	}
	document.getElementById('csvOutput').innerHTML = csv;

	// Generate a hidden link which will be used for the CSV file download (works with most browsers)
	var a = document.createElement('a');
	a.href = 'data:text/csv;charset=utf-8,' + encodeURI(csv);
	a.target = '_blank';
	a.download = 'results.csv';
	a.click();
}
</script>
